{"cells":[{"source":"<a href=\"https://www.kaggle.com/deyjahmckenzie/bellabeat-capstone-in-r?scriptVersionId=88423535\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"2d13358f","metadata":{"papermill":{"duration":0.130723,"end_time":"2022-02-21T22:38:34.85042","exception":false,"start_time":"2022-02-21T22:38:34.719697","status":"completed"},"tags":[]},"source":["# Bellabeat Capstone in R\n","\n","*Last updated: 2/3/2022*\n","\n","## Introduction\n","\n","This analysis project is apart of the Google Data Analytics Capstone. In order to answer the key business questions, I will be following the steps of the data analysis process: ask, prepare, process, analyze, share, and act. Due to the size and nature of the data utilized in this project, I will be conducting all of my analysis in R.\n","\n","\n","## Overview\n","Founded by Urška Sršen and Sando Mur, Bellabeat is a high tech company that manufactures stylish health-focused smart products. Since its founding in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company by and for women. However, despite the company's success, Co-founder and CCO, Urška Sršen believes that a proper analysis of Bellabeat’s available consumer data, would reveal more opportunities for growth.\n","\n","## Ask\n","\n","**Business Task:** \n","\n","The objective of this analysis is to identify trends in consumer usage of non-Bellabeat smart devices and see how these trends can be applied to improve Bellabeat products.\n","\n","**Prep Questions related to analysis:**\n","\n","1. How can we categorize customers based on their activity? \n","\n","2. What are the characteristics/behaviors of these customer categories? \n","\n","3. How can the trends of these categories be used to increase and improve consumer usage and satisfaction of Bellabeat products?\n","\n","## Prepare\n","\n","**Dataset Description:** \n","\n","The dataset that will be used in this analysis is the FitBit Fitness Tracker Data <https://www.kaggle.com/arashnic/fitbit>. This dataset contains various records of tracked health data, including, but not limited to, minute-level output for physical activity, heart rate, and sleep monitoring, of thirty FitBit users.\n","\n","**Data Limitations:**\n","\n","1. There are many files, all of which contain various sets of consumer data. In other words, the data is very large. \n","\n","2. The data is second-party data due to the fact that it was collected from a similar product, FitBit, and not Bellabeat directly.\n","\n","3. There is limited information on the FitBit users, such as gender, age, or demographic.\n","\n","4. The data is not up to data or current. It was collected in 2016.\n","\n","**Data for Analysis:**\n","\n","For my analysis, I will be using the following data: \n","\n","* dailyActivity_merged.csv \n","\n","* dailyCalories_merged.csv \n","\n","* dailyIntensities_merged.csv \n","\n","* dailySteps_merged.csv \n","\n","* sleepDay_merged.csv \n","\n","* weightLogInfo_merged.csv"]},{"cell_type":"markdown","id":"edde0135","metadata":{"papermill":{"duration":0.128968,"end_time":"2022-02-21T22:38:35.10827","exception":false,"start_time":"2022-02-21T22:38:34.979302","status":"completed"},"tags":[]},"source":["**Installing and loading all of the packages that we will be using**"]},{"cell_type":"code","execution_count":1,"id":"b7cc234d","metadata":{"execution":{"iopub.execute_input":"2022-02-21T22:38:35.371763Z","iopub.status.busy":"2022-02-21T22:38:35.369954Z","iopub.status.idle":"2022-02-21T22:40:35.901523Z","shell.execute_reply":"2022-02-21T22:40:35.900719Z"},"papermill":{"duration":120.664777,"end_time":"2022-02-21T22:40:35.901709","exception":false,"start_time":"2022-02-21T22:38:35.236932","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","outp