"display_data"}],"source":["\n","ggplot(sleep_rest, mapping = aes(fill=Category, y=Minutes, x = Day)) + \n","  geom_bar(position=\"stack\", stat=\"identity\") +\n","  labs(title = \"Distribution of Time Asleep vs Time Resting in Bed By Day\")\n"]},{"cell_type":"markdown","id":"0339a373","metadata":{"papermill":{"duration":0.314387,"end_time":"2022-02-21T22:41:11.711741","exception":false,"start_time":"2022-02-21T22:41:11.397354","status":"completed"},"tags":[]},"source":["This stacked bar graph shows the distribution between time sleeping and time resting in bed by day. Based on this graph, majority of the total time spent in bed is spent sleeping while a small portion of that time is spent resting, but awake in bed."]},{"cell_type":"markdown","id":"78d3ef7f","metadata":{"papermill":{"duration":0.312283,"end_time":"2022-02-21T22:41:12.349772","exception":false,"start_time":"2022-02-21T22:41:12.037489","status":"completed"},"tags":[]},"source":["## Share and Act\n","\n","There are a lot of interesting things that we discovered while anaylzing the data. Unfortunately, due to the limitations of the data, I am not sure if it will all prove useful or accurate to the Bellabeat's target audience which are women. However, there are some general points that can be employed in the company's future marketing strategies.\n","\n","**Key Findings:**\n","\n","* Majority of the users utilize the Activity and Sleep features of the smart device. Very little users utilize the Weight Log features.\n","\n","* Users were most active on Tuesdays and Saturdays.\n","\n","* Users slept the most on Sundays.\n","\n","* A very large portion of users engaged in light activity or no activity at all(sedentary).\n","\n","**Recommendations:**\n","\n","* Being a company geared towards health, Bellabeat could implement short-term and long-term challenges and goals for users as incentives to get or stay consistent in their activeness. They could also include some kind of reward system along with it. For example, users would be issued badges, points, and/or titles for specific milestones, challenges, and goals completed.\n","\n","* Bellabeat should put more emphasis on marketing their devices for their stylishness and comfortability. Seeing as not many of the FitBit users were active or even using features such as the weight log, I think it would be beneficial to focus more on the devices' ability to be something that can be worn everyday,all day and simultaneously does all the health tracking for you. Bellabeat devices should be described as chic, fashionable, and subtle self-care devices that will sync, track, and stored all your health data to your phone via the Bellabeat app. To compliment this style, a notification system should also be install. Something like a vibration or noise that will trigger whenever there is an important change in the health data, to signify completed goals, milestones, and challenges, and as a reminder for certain things such as when to hydrate.\n","\n","* Since we observed that users of the fitbit are active and not active on certain days, the Bellabeat app should allow users to customize settings such as notifications, reminders, goals, and things of that nature to match up with their life and daily routine.\n","\n","## Closing\n","\n","Though I was only able to provide a few key findings and recommendations, I believe that the obersavtions and conclusions made will prove useful. I do plan on returning to this project for future analysis, perhaps with new data, as well as, the other FitBit Tracker datasets. Until then, please feel free to provide feedback. This is my first full analysis and I know there are things that I could have done better, so I welcome any and all advice and/or constructive critisim. Thank you!"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"